window.FIGMA_BUNDLE = (function () {
  const pathsForModules = (() => {
    const _paths = {
      'heic': "https://www.figma.com/esbuild-artifacts/ef853b73d95b30e28035da3ef0a36a7e433142ef/js/heic.min.js.br",
      'hunspell': "https://www.figma.com/esbuild-artifacts/ef853b73d95b30e28035da3ef0a36a7e433142ef/js/hunspell.min.js.br",
      'pdfjs': "https://www.figma.com/esbuild-artifacts/ef853b73d95b30e28035da3ef0a36a7e433142ef/js/pdfjs.min.js.br",
      'videojs': "https://www.figma.com/esbuild-artifacts/ef853b73d95b30e28035da3ef0a36a7e433142ef/js/videojs.min.js.br",
    };

    const _loadedPaths = new Set()
    return {
      get: (key) => {
        return _paths[key];
      },
      hasLoaded: (key) => {
        return _loadedPaths.has(key)
      },
      setHasLoaded: (key) => {
        return _loadedPaths.add(key)
      },
    };
  })();

  const values = {};
  const promises = {};

  return {
    export: function (name, value) {
      if (!pathsForModules.get(name)) {
        console.warn('please add the "js_path" declaration in "pathsForModules" for "' + name + '".');
        return;
      }
      values[name] = value;
    },

    import: function (name) {
      const FAILURE_TEXT = 'failed to load "' + name + '" module!'
      if (values[name]) return Promise.resolve(values[name])

      const path = pathsForModules.get(name);
      if (!pathsForModules.get(name)) {
        return Promise.reject({ error: FAILURE_TEXT + ' "' + name + '" has not been added to "pathsForModules".' })
      }

      if (promises[path]) {
        return new Promise((resolve, reject) => {
          promises[path].then(_ => resolve(values[name])).catch(error => reject({ error }));
        });
      }

      const promise = new Promise((resolve, reject) => {
        if (promises[path]) return;

        const script = document.createElement("script");
        script.setAttribute("async", true);
        script.setAttribute("nonce", "alVOe9csaeYSoux+Fkq2Rw==")

        script.onload = function () {
          resolve(values[name])
        };
        script.onerror = function (error) {
          reject(error)
        };

        script.src = pathsForModules.get(name);
        pathsForModules.setHasLoaded(name);
        document.body.appendChild(script)
      });
      promises[path] = promise;
      return promise;
    },
  };
})();

